data:
  definition: bornes, faisant partie du boîtier en plastique du connecteur, qui s’engagent
    dans des trous correspondants de la carte imprimée pour fournir une fixation mécanique
    à la carte
  examples: []
  notes:
  - Les tiges de fixation peuvent être déformées en appliquant, par exemple, une tête
    porte-outil chauffée.
